import React from 'react';
import styled from 'styled-components';
import SearchIcon from '@material-ui/icons/Search';

const SearchBox = styled.input`
    width: 350px;
    height: 30px;
    border-radius: 15px;
    border: 1px solid #707070;
    position: absolute;
    margin-top: 200px;
`;

const Searchbar = () => {
    return (
        <React.Fragment>
            <SearchBox />
            <SearchIcon />
        </React.Fragment>
    );
};

export default Searchbar;
